INSERT INTO `ObjectLog` VALUES (2,504,'admin','2018-09-10 06:33:51','setfacl -R -m u:dbadmusr:rwx /DEV_DB_BACKUP '),(3,118,'admin','2018-09-18 17:23:59','Installing the Microsoft ODBC Driver for SQL Server on Linux(rhel 6.5):-- \n\nyum remove unixODBC --> remove default package in rhel6.5\n\nyum install unixODBC --> install lastest download package\n\nyum update openssl --> update lastest openssl package from centos6.10 repo \n\nyum install msodbcsql-13.1.9.2-1.x86_64 --> driver mssql install\n\nyum install mssql-tools-14.0.6.0-1.x86_64 --> mssql tool install'),(5,28,'admin','2018-09-27 15:18:40','[root@kendrak yum.repos.d]# yum remove unixODBC --> rhel-6.5 remove old packages\n[root@kendrak yum.repos.d]# yum install unixODBC  --> install new unixodbc driver from microsoft site or our local repo package \n[root@kendrak yum.repos.d]# yum install msodbcsql-13.1.9.2-1.x86_64 --> odbc driver installed\n[root@kendrak yum.repos.d]# yum install mssql-tools-14.0.6.0-1.x86_64 --> ms tool install\n\necho \'export PATH=\"$PATH:/opt/mssql-tools/bin\"\' >> ~/.bash_profile\necho \'export PATH=\"$PATH:/opt/mssql-tools/bin\"\' >> ~/.bashrc\nsource ~/.bashrc\n# optional: for unixODBC development headers\nsudo yum install unixODBC-devel\n\nexec bash \n\nsqlcmd\n\nMicrosoft (R) SQL Server Command Line Tool\nVersion 13.1.0007.0 Linux\nCopyright (c) 2012 Microsoft. All rights reserved. '),(6,473,'admin','2018-09-27 15:26:36','[root@sapbwdev infrausr]# fdisk /dev/sdc\nWelcome to fdisk (util-linux 2.23.2).\n\nChanges will remain in memory only, until you decide to write them.\nBe careful before using the write command.\n\nDevice does not contain a recognized partition table\nBuilding a new DOS disklabel with disk identifier 0x0fcbd618.\n\nCommand (m for help): n\nPartition type:\n   p   primary (0 primary, 0 extended, 4 free)\n   e   extended\nSelect (default p): p\nPartition number (1-4, default 1):\nFirst sector (2048-671088639, default 2048):\nUsing default value 2048\nLast sector, +sectors or +size{K,M,G} (2048-671088639, default 671088639):\nUsing default value 671088639\nPartition 1 of type Linux and of size 320 GiB is set\n\nCommand (m for help): w\nThe partition table has been altered!\n\nCalling ioctl() to re-read partition table.\nSyncing disks.\n--\n[root@sapbwdev infrausr]# fdisk -l | grep sdc\nDisk /dev/sdc: 343.6 GB, 343597383680 bytes, 671088640 sectors\n/dev/sdc1            2048   671088639   335543296   83  Linux\n---------\n\n[root@sapbwdev infrausr]# pvcreate /dev/sdc1\n  Physical volume \"/dev/sdc1\" successfully created\n\n[root@sapbwdev infrausr]# vgcreate sapbwdump /dev/sdc1\n  Volume group \"sapbwdump\" successfully created\n\n[root@sapbwdev infrausr]#  lvcreate -n sapdump --size 300G sapbwdump\n  Logical volume \"sapdump\" created.\n\n mkfs.ext4 /dev/mapper/sapbwdump-sapdump\n  \n  \n[root@sapbwdev /]# mount /dev/mapper/sapbwdump-sapdump /sapdump-new\n\ncat /etc/fstab \n/dev/mapper/sapbwdump-sapdump /sapdump-new ext4    defaults        1 2\n\n umount /dev/mapper/sapbwdump-sapdump /sapdump-new\n '),(7,742,'admin','2018-10-05 12:16:55','lvcreate  --> lvcreate -n sapdump --size 100G susevg\nmkfs with btrfs --> mkfs.btrfs /dev/mapper/susevg-sapdump\nmount lv --> mount /dev/mapper/susevg-sapdump   /sapdump\nentry in fstab--> /dev/mapper/susevg-sapdump   /sapdump		btrfs      defaults              0 0\n\nlvextend--> lvextend -L+50G /dev/mapper/susevg-hanadata\nresize--> btrfs filesystem resize max /hana/data'),(8,26,'admin','2018-10-27 13:10:54','networkstop--> /sbin/init.d/net stop\nnetworkstart--> /sbin/init.d/net start\n\nsap stop -->  su - xipadm   --> stopsap krishi\nListner stop -->  lsnrctl stop \noracle stop --> su - oraxip --> sqlplus \"/as sysdba\" --> stop\n\nlistner & oracle start -->  su - oraxip --> lsnrctl start --> sqlplus \"/as sysdba\" -->startup\n\nsap start-->  su - xipadm --> startsap krishi \n\narchlog start \n\nioscan for tape --> ioscan -fnC tape \n'),(11,470,'admin','2018-11-20 19:33:43','pmm-admin config --server 10.61.2.123 --server-user admin --server-password admin'),(12,470,'admin','2018-11-20 19:35:46','pmm-admin add mysql:queries --user root --password Reset@123'),(13,470,'admin','2018-11-20 19:36:10','pmm-admin add mysql --user root --password Reset@123'),(15,872,'admin','2018-11-26 12:07:13','visudo --> fbdusr   ALL=(ALL) NOPASSWD: /sbin/shutdown -r now, /sbin/shutdown -h now'),(16,549,'admin','2018-12-21 14:27:21','zabbix start --> ./zabbix_agentd -c /home/zabbix/conf/zabbix_agentd.conf'),(17,37,'admin','2018-12-28 11:01:49','Installation of SAP NetWeaver 7.51 and later on Red Hat Enterprise Linux 6 fails with the message \'GLIBCXX_3.4.14\' not found--> https://access.redhat.com/solutions/2670361'),(18,982,'admin','2018-12-31 14:35:58','reconnect -r \nmap -r '),(19,23,'admin','2019-01-02 18:26:29','rpm -qa | grep msodbcsql\n  660  cd /etc/yum.repos.d/\n  661  ls\n  662  mv rhel-source.repo rhel-source.repo_old\n  663  mv packagekit-media.repo packagekit-media.repo_old\n  664  vim client.repo\n  665  yum makecache\n  666  yum repolist\n  667  yum remove unixODBC\n  668  yum install unixODBC\n  669  yum install msodbcsql-13.1.9.2-1.x86_64\n  670  cat /etc/redhat-release\n  671  vim client.repo\n  672  yum makecache\n  673  yum repolist\n  674  yum install msodbcsql-13.1.9.2-1.x86_64\n  675  yum update unixODBC\n  676  ps -ef | grep odbc\n  677  yum remove unixODBC\n  678  yum update unixODBC\n  679  yum install msodbcsql-13.1.9.2-1.x86_64\n  680  yum update openssl\n  681  yum install msodbcsql-13.1.9.2-1.x86_64\n  682  yum install msodbcsql-13.1.9.2-1.x86_64 --nodeps\n  683  yum install msodbcsql-13.1.9.2-1.x86_64\n  684  vim client.repo\n  685  yum makecache\n  686  yum repolist\n  687  yum update openssl\n  688  yum install msodbcsql-13.1.9.2-1.x86_64\n  689  yum install mssql-tools-14.0.6.0-1.x86_64\n  690  echo \'export PATH=\"$PATH:/opt/mssql-tools/bin\"\' >> ~/.bash_profile\n  691  echo \'export PATH=\"$PATH:/opt/mssql-tools/bin\"\' >> ~/.bashrc\n  692  source ~/.bashrc\n  693  sqlcmd\n  694  ls\n  695  vim client.repo\n  696  mv client.repo client.repo_old\n'),(20,26,'admin','2019-01-19 11:11:30','#ifconfig lan0 down\n#ifconfig lan0 up'),(25,32,'admin','2019-01-19 11:56:41','vgchange -a y /dev/vgashirwad/ashirwad\nmount -a\n/u03\n\nfsck -F vxfs /dev/vgashirwad/ashirwad\nmount -a \nbdf '),(26,31,'admin','2019-01-19 12:37:10','\nioscan -fnC disk\n\nvgchange -a y /dev/vgarya\n\nmount /dev/vgarya/aryaweb /w01\n\ntail -3500 /var/adm/syslog/syslog.log | more'),(27,32,'admin','2019-01-19 18:16:38',' netstat -nrw\ninetd -C'),(28,116,'admin','2019-01-21 10:47:54','for boot os --> ilo shell> fs0: --> efi --> '),(29,987,'admin','2019-01-21 15:54:29','showsysmgr\nshownode\ncheckhealth'),(30,987,'admin','2019-01-21 15:54:44','showhost\n'),(31,987,'admin','2019-01-21 16:06:49','showld\nshowvv\nshowvv -cpgalloc'),(32,983,'admin','2019-02-04 17:55:43','lvextend -L+120G /dev/mapper/s4data--dev-hanadata\n\n xfs_growfs -d /hana/data'),(33,1066,'admin','2019-03-14 12:40:44','storage unit path --> /saphanadb\n'),(34,1066,'admin','2019-03-14 12:41:24','rpm -ivh emcdbappagent-4.7.0.0-1.x86_64.rpm\n\nvim /etc/hosts\n###########IDPA-BACKUP-AGENT########################\n172.25.11.24    tidpa-node1     tidpa-node1.sysadm.com\n172.25.11.25    tidpa-node2     tidpa-node2.sysadm.com\n\n\n\n#######################################################\nSiddhi --> /hana/shared/THP/global/hdb/opt \nrddhi-->   /hana/shared/THP/global/hdb/opt\nTS4QDSVR -->  /hana/shared/THQ/global/hdb/opt\n\nSiddhi  --> ln -s /opt/ddbda/bin/hdbbackint /hana/shared/THP/global/hdb/opt/hdbbackint\nrddhi   -->  ln -s /opt/ddbda/bin/hdbbackint /hana/shared/THP/global/hdb/opt/hdbbackint\nTS4QDSVR --> ln -s /opt/ddbda/bin/hdbbackint /hana/shared/THQ/global/hdb/opt/hdbbackint\n\n###############################################################################\n/opt/ddbda/bin/./ddbmadmin -L\n\nrovide full pathname for the lockbox, or press Enter to accept the default directory (/opt/dpsapps/common/lockbox):\nUsing the default pathname \'/opt/dpsapps/common/lockbox\' for lockbox.\n\nProvide a group ID for lockbox ownership, or type 0 to accept the \'root user\' group as the lockbox owner: 79\nLockbox has been successfully created in the directory \'/opt/dpsapps/common/lockbox\' with group ownership 79.\n\n\n79 --> group id sapsys\n#######################################################################\ncp /opt/dpsapps/dbappagent/config/sap_hana_ddbda.utl /opt/dpsapps/dbappagent/config/sap_hana_ddbda.utl_orig\n\n\nvim /opt/dpsapps/dbappagent/config/sap_hana_ddbda.utl\n\n[PRIMARY_SYSTEM]\n\n  DDBOOST_USER = DDBoostHana\n  DEVICE_HOST = tidpa-node1.sysadm.com\n  DEVICE_PATH = /saphanadb\n  CLIENT = nivedana\n  LOCKBOX_PATH = /opt/dpsapps/common/lockbox\n\nCLIENT = siddhi\nCLIENT = rdhhi\nCLIENT = ts4qdsvr\n\n/opt/ddbda/bin/./ddbmadmin -P -z  /opt/dpsapps/dbappagent/config/sap_hana_ddbda.utl\n\nBckhana-2019\n\n\nPerforming the registration of the device host \'tidpa-node1.sysadm.com\' for DD Boost user \'DDBoostHana\'.\n\nEnter password:\n\nType again to confirm:\nLogging in to the device host \'tidpa-node1.sysadm.com\' with DD Boost credentials was successful.\n\nLockbox directory is \'/opt/dpsapps/common/lockbox\'.\nDevice host \'tidpa-node1.sysadm.com\' for DD Boost user \'DDBoostHana\' has been registered in the lockbox.\n#################################################################################'),(35,1001,'admin','2019-03-14 13:40:01','physical disk info --> showpd -i \nphysical cage info --> showcage -d \nphysical failure -->  showpd -s -failed -degraded\nservicemag status -d\nhelath info --> checkhealth -svc -details\n'),(36,998,'admin','2019-03-18 09:34:49','\nshow npar\nconnect npar pnum=0 \npower off npar pnum=0\n\n'),(37,1005,'admin','2019-03-18 09:35:15','show npar\nconnect npar pnum=0 \npower off npar pnum=0'),(38,1077,'admin','2019-03-25 12:42:05','rsync -a --progress /usr/sap/* root@10.61.3.88:/usr/sap/\n\n\nrsync -a --progress /usr/sap/TAFE_REPOSITORY/* root@10.61.3.88:/usr/sap/TAFE_REPOSITORY/\n\n\n\n\nserver : \n/etc/exports\n/sapmnt/TFP     10.61.3.88(rw,sync,no_root_squash)\n systemctl status nfsserver\n systemctl enable nfsserver\n\nclient \n\n systemctl start nfs\n systemctl enable nfs\n10.61.3.87:/sapmnt/TFP /sapmnt/TFP    nfs     rw,sync,hard,intr  0 0\n'),(40,1077,'prabhakaran','2019-03-29 17:56:48','\n\nvim .cshrc\nsetenv PATH ${PATH}:/opt/mssql-tools/bin\n\nvridhi:/usr/lib64 # \n\nln -s /usr/lib64/libodbc.so.2.0.0 /usr/lib64/libodbc.so.1\n\nln -s /usr/lib64/libodbcinst.so.2.0.0 /usr/lib64/libodbcinst.so.1');
